import "../index.css";
import { useContext } from "react";
import { ContextGlobal } from "./utils/global.context";


const Footer = () => {

  const img= "public/images/DH.png"
  const fb= "public/images/ico-facebook.png"
  const wp=  "public/images/ico-whatsapp.png"
  const ig= "public/images/ico-instagram.png"
  const tik= "public/images/ico-tiktok.png"

  //const { state } = useContext(ContextGlobal);
  const theme = state.theme === "dark" ? "dark" : "light";
  return (
    <footer className={theme}>
      <div>
        <img className="logo" src={img} alt="DH-logo" />
      </div>
      <div>
        <a href="www.facebook.com">
          {" "}
          <img className="redes" src={fb} alt="" />
        </a>
        <a href="www.instagram.com">
          {" "}
          <img className="redes" src={ig} alt="" />
        </a>
        <a href="www.whatsapp.com">
          {" "}
          <img className="redes" src={wp} alt="" />
        </a>
        <a href="www.tiktok.com">
          {" "}
          <img className="redes" src={tik} alt="" />
        </a>
      </div>
    </footer>
  );
};

export default Footer;
